import React from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";
// import './index.css';
import CardExample from '../Cards/customCard';

const gridExamplesPage = () => {
  return (
    <MDBContainer>
      <MDBRow>
        <MDBCol md="5">
        <CardExample />
        </MDBCol>
        <MDBCol md="5"><CardExample /></MDBCol>
        {/* <MDBCol md="5"><CardExample /></MDBCol> */}
      </MDBRow>
    </MDBContainer>
  );
}

export default gridExamplesPage;
